var active_GapSize_idx = 0; // 0 -- 9 'gap size: 5, 10, 15, 20, 25, 30, 35, 40, 45, 50 ms'
var active_value = 0; // 0 -- 2 'None', 'SNR', 'PEMO-Q'

var clicked_SDR_id = 0;
var clicked_value_id = 0;
                               
var GapSizes = [5, 10, 15, 20, 25, 30, 35, 40, 45, 50];

var sounds = ['a08', 'a16', 'a18', 'a25', 'a35', 'a41', 'a42', 'a58', 'a60', 'a66'];

var sounds_label = ['Violin', 'Clarinet', 'Bassoon', 'Harp', 'Glockenspiel', 'Celesta', 'Accordion', 'Guitar', 'Piano', 'Wind ensemble']

var algorithms = ['anchor', 'DR', 'CP', 'wDR', 'wCP', 'reDR', 'reCP', 'tdc', 'SSPAIN_H', 'ASPAIN', 'OMP', 'Janssen'];

var algorithms_label = ['original', 'with gaps', 'l1 DR', 'l1 CP', 'l1 wDR', 'l1 wCP', 'l1 reDR', 'l1 reCP', 'TDC', 'S-SPAIN_H', 'A-SPAIN', 'OMP', 'Janssen'];	


function Change_GapSize(GapSize_idx, clicked_id){
	
	active_GapSize_idx = GapSize_idx;
	
	var myTable = document.getElementById('errtable1');
	//myTable.rows[4].cells[4].innerHTML = clicked_id;
	
	if (clicked_SDR_id == 0) { // initialization
		clicked_id = "25ms";
		clicked_SDR_id = "25ms"
		active_GapSize_idx = 4;  // 4 corresponds to 25 ms, numbering from zero 
	}
  
	var old_clicked = document.getElementById(clicked_SDR_id);
	old_clicked.setAttribute('class', '');
  
	var new_clicked = document.getElementById(clicked_id)
	new_clicked.setAttribute('class', 'clicked')
	clicked_SDR_id = clicked_id;
	
	var snd;
	var alg;
	
	for (alg = 0; alg < 12; alg++) {
		for (snd = 0; snd < 10; snd++) {
			//if (GapSizes[active_GapSize_idx] < 10) {
//				if (alg == 0) {
//					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'wavs/'+algorithms[alg]+algorithms[alg]+'/'+sounds[snd]+'_0'+GapSizes[active_GapSize_idx].toString()+'.wav'); //anchor (with gaps)
//				} else {
//					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'wavs/'+algorithms[alg]+algorithms[alg]+'/'+sounds[snd]+'_'+GapSizes[active_GapSize_idx]+algorithms[alg]+'_'+'0'+GapSizes[active_GapSize_idx].toString()+'.wav');				
//				}	
//			} else {
				if (alg == 0) {
					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'wavs/'+algorithms[alg]+'/'+sounds[snd]+'_'+GapSizes[active_GapSize_idx]+'_'+algorithms[alg].toString()+'.wav');  //anchor (with gaps)
				} else {
					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'wavs/'+algorithms[alg]+'/'+sounds[snd]+'_'+GapSizes[active_GapSize_idx]+'_'+algorithms[alg].toString()+'.wav');				
//				}
			}
		}
	}
	
	Change_values(active_value, clicked_value_id);
	Change_titles();

}


function Change_values(value, clicked_id) {
	
	active_value = value;
	
	if (clicked_value_id == 0) {       // asi inicializace
		clicked_id = "none";
		clicked_value_id = "none"
	}
	var old_clicked = document.getElementById(clicked_value_id);
	old_clicked.setAttribute('class', '');
	var new_clicked = document.getElementById(clicked_id)
	new_clicked.setAttribute('class', 'clicked')
	clicked_value_id = clicked_id;
	
	var myTable = document.getElementById('errtable1');

	var snd;
	var alg;
	   	
	if (value == 1) { // SNR
		for (alg = 1; alg < 12; alg++) {
			for (snd = 0; snd < 10; snd++) {
				myTable.rows[alg+2].cells[snd+1].innerHTML = (SNR[alg][snd][active_GapSize_idx].toFixed(2)).toString().replace('-','&minus;');
				//myTable.rows[alg+2].cells[snd+1].style.textAlign = 'right';
				myTable.rows[alg+2].cells[snd+1].setAttribute('class', 'clickable clickable_right');
				//myTable.rows[alg+2].cells[snd+1].setAttribute('title', sounds[snd].substring(4)+' '+algorithms[alg]+' '+GapSizes[active_GapSize_idx].toString() )
			}
		}
	} else if (value == 2) { //PEMO-Q 
		for (alg = 1; alg < 12; alg++) {
			for (snd = 0; snd < 10; snd++) {
				myTable.rows[alg+2].cells[snd+1].innerHTML = (PEMO_Q[alg][snd][active_GapSize_idx].toFixed(2)).toString().replace('-','&minus;');
				//myTable.rows[alg+2].cells[snd+1].style.textAlign = 'right';
				myTable.rows[alg+2].cells[snd+1].setAttribute('class', 'clickable clickable_right');
			}
		}
	} else { // blind, X on all positions
		for (alg = 0; alg < 12; alg++) {
			for (snd = 0; snd < 10; snd++) {
				myTable.rows[alg+2].cells[snd+1].innerHTML = '&times;';
				//myTable.rows[alg+2].cells[snd+1].style.textAlign = 'center';
				myTable.rows[alg+2].cells[snd+1].setAttribute('class', 'clickable');
			}
		}
	}
  	
}

function Change_titles() {
	
	var myTable = document.getElementById('errtable1');
  
	for (alg = 0; alg < 13; alg++) {
		for (snd = 0; snd < 10; snd++) {
			if (alg == 0) {
				myTable.rows[alg+1].cells[snd+1].setAttribute('title', sounds_label[snd]+' original '+GapSizes[active_GapSize_idx].toString()+' ms' );
			} else {
				myTable.rows[alg+1].cells[snd+1].setAttribute('title', sounds_label[snd]+' '+algorithms_label[alg]+' '+GapSizes[active_GapSize_idx].toString()+' ms' );
			}				
		}
	}
	
	
}

